export default () => {
  const comparisonColdef = [
    {
      Header: 'Scenario',
      accessor: 'scenario',
      width: 50,
      align: 'left',
      // width: 50,
      // align: "left",
    },
    {
      Header: 'Sell Through %',
      accessor: 'Sell Through %',
      width: 50,
      align: 'left',
      // width: 50,
      // align: "left",
    },
    {
      Header: 'Margin %',
      accessor: 'Margin %',
      width: 50,
      align: 'left',
    },
    {
      Header: 'AUR ($)',
      accessor: 'AUR ($)',
      width: 50,
      align: 'left',
    },
    {
      Header: 'AUM ($)',
      accessor: 'AUM ($)',
      width: 50,
      align: 'left',
    },
    {
      Header: 'MD Budget Utilises ($)',
      accessor: 'MD budget Utilised($)',
      width: 50,
      align: 'left',
    },
    {
      Header: 'Left Over Inventory',
      accessor: 'Left OVer Inventory',
      width: 50,
      align: 'left',
    },
    {
      Header: 'Revenue ($)',
      accessor: 'Revenue ($)',
      width: 50,
      align: 'left',
    },
    {
      Header: 'Margin ($)',
      accessor: 'Margin ($)',
      width: 50,
      align: 'left',
    },
    {
      Header: 'Units',
      accessor: 'Units',
      width: 50,
      align: 'left',
    },
  ];
  return comparisonColdef;
};
